import React from "react";

const Posts = ({posts}) => {
    return (
        <>
            <h1>Items for Sale</h1>
            <div>
                {posts.map((item) => {
                    return <PostList key={item.id} post={item} />;
                })}
            </div>
        </>
    )
};

export default Posts;
